Using the quadratic formula, we find that the roots of the quadratic are $\frac{-5\pm\sqrt{5^2-4(3)(k)}}{6}=\frac{-5\pm\sqrt{25-12k}}{6}$. Since the problem tells us that these roots must equal $\frac{-5\pm i\sqrt{11}}{6}$, we have \begin{align*} \sqrt{25-12k}&=i\sqrt{11}
\\\Rightarrow\qquad \sqrt{25-12k}&=\sqrt{-11}
\\\Rightarrow\qquad 25-12k&=-11
\\\Rightarrow\qquad 12k&=36
\\\Rightarrow\qquad k&=\boxed{3}.
\end{align*}

We have the equation $\frac{2x-1}{2x+2}=\frac{x-3}{x-1}$. Cross-multiplying and simplifying, we get \begin{align*}
(2x-1)(x-1)&=(2x+2)(x-3)\\
2x^2 - x - 2x + 1 &= 2x^2 + 2x - 3 \cdot 2x - 3 \cdot 2 \\
2x^2 - 3x + 1&=2x^2-4x-6\\
x&=\boxed{-7}
\end{align*}

We substitute these two points into the given equation to solve for $c$. Plugging in $(2,3)$, we get $3=2^2+2b+c\Rightarrow 2b+c=-1$. Plugging in $(4,3)$, we get $3=4^2+4b+c \Rightarrow 4b+c=-13$. In summary, we have the two equations \begin{align*}
2b+c&=-1\\
4b+c&=-13
\end{align*} Multiplying the first equation by 2, we have $4b+2c=-2$. Subtracting the second equation from this last one, we have $(4b+2c)-(4b+c)=-2-(-13) \Rightarrow c=\boxed{11}$.

